graphviz:
digraph {
  // Graph attributes
  label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"></table>>;
  labelloc="t";
  fontsize=10;
  fontname="Arial";
  compound=true;
  rankdir=TB;
  pad=0.25;
  node [fontname="Arial", fontsize=10];
  edge [fontname="Arial", fontsize=9];

  // Node definitions with nested namespaces
  subgraph cluster_API {
    label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="2"><tr><td align="center"><b>API</b></td></tr></table>>;
    labelloc="t";
    style=filled;
    fontsize=10;
    fillcolor="#FFFFFF";
    color="#999999";
    "API__cluster_anchor" [shape=point, width=0.01, height=0.01, label="", style=invis, fixedsize=true];

    subgraph cluster_Auth {
      label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="2"><tr><td align="center"><b>Auth</b></td></tr></table>>;
      labelloc="t";
      style=filled;
      fontsize=10;
      fillcolor="#FFFFFF";
      color="#999999";
      "Auth__cluster_anchor" [shape=point, width=0.01, height=0.01, label="", style=invis, fixedsize=true];

      "Login" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>Login</b></td></tr></table>>, shape=box, fillcolor="#FFFFFF", style=filled, color="#000000"];
      "Logout" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>Logout</b></td></tr></table>>, shape=box, fillcolor="#FFFFFF", style=filled, color="#000000"];
    }
    subgraph cluster_Data {
      label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="2"><tr><td align="center"><b>Data</b></td></tr></table>>;
      labelloc="t";
      style=filled;
      fontsize=10;
      fillcolor="#FFFFFF";
      color="#999999";
      "Data__cluster_anchor" [shape=point, width=0.01, height=0.01, label="", style=invis, fixedsize=true];

      "Fetch" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>Fetch</b></td></tr></table>>, shape=box, fillcolor="#FFFFFF", style=filled, color="#000000"];
      "Store" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>Store</b></td></tr></table>>, shape=box, fillcolor="#FFFFFF", style=filled, color="#000000"];
    }
  }
  "Start" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>Start</b></td></tr></table>>, shape=ellipse, fillcolor="#FFF3E0", style=filled, color="#F57C00"];

  // Edges
  "Start" -> "Login" [labelOverlay="75%", labelhref="#srcLineTBD"];
  "Login" -> "Fetch" [labelOverlay="75%", labelhref="#srcLineTBD"];
}
